import styled from "styled-components";

export const Container = styled.div``;
export const RegisterWrapper = styled.div``;
export const RegisterInput = styled.input`
  width: 100%;
  padding: 1rem;
  margin: 10px;
  border-radius: 12px;
  outline: none;
  background-color: transparent;
  border: 2px solid #d7263d;
`;
